France, Loire, Montlouis-sur-Loire 'Cabotines' 2022, Ludovic Chanson Après une carrière dans une grande entreprise pharmaceutique, Ludovic Chanson a recommencé une nouvelle vie en créant son domaine en 2009 à Montlouis. C'est avec Stéphane Cossais (décédé tragiquement en 2009
) et également avec Vincent Carême à Vouvray, que Ludovic a eu le déclic qui lui a donné envie de devenir vigneron. Il a également beaucoup appris au Domaine La Grange Tiphaine (Coralie et Damien Delecheneau) à Amboise, où il a passé un certain temps de formation. Il a aussi beaucoup appris avec Nicolas Renard (Amboise). Début 2009, Ludovic a trouvé des vignes à vendre sur 6,5 hectares. Le vignoble appartenait au Domaine Levasseur (Alex Mathur) et les vignes étaient déjà cultivées en agriculture biologique depuis 2006. Biologique Fermentation via levures indigènes en cuve inox avec débourbage à froid. 12 mois dans de vieux barriques de chêne âgés de 1 à 7 ans Nez sur de magnifiques notes de coing, de fruits jaunes frais, d'anis, de citron vert, de fruits exotiques avec une pointe herbacée. La bouche est pleine et fraiche grâce à un remarquable équilibre entre gras, finesse du fruit et trame minérale rafraichissante. - Age vignes: moyenne 40 ans
- Sol: Argile et Silex France Ludovic Chanson Ludovic Chanson 14745417 null

Quebec, Kamouraska, Regent 'Le Recul' 2023, Ferme Le Raku L’origine du nom LE RAKU:  est, en jargon populaire, une déformation du mot « recul ». Il désigne pour le terrain une sorte de baie reculée à l’intérieur des terres qui est encastrée dans la montagne. En japonais, le mot raku signiﬁe aussi « joie, spontanéité ». Agriculture Biologique depuis 2003 fermentation en grappes entières; 
cuve inox élevage de 10 mois en fût; 
petite proportion en cuve inox, pour conserver le fruit un nez charmeur sur le fruit; en bouche, un bel équilibre; notes de cerise
et de poivre; 
légers tanins; acidité fraîche Située à Saint-Germain-de-Kamouraska, la ferme Le Raku s’adonne à la production de grains et de petits fruits, via les 64 hectares qu’elle dénombre, éparses entre fleuve et montagnes. QUEBEC  Ferme Le Raku  Samuel Lavoie 2023 Regent null
